这是Twitter的相互支持工具！
你可以找到你正在追踪的人没有追随你，而你可以找到你没有追随的人追随你。你也可以按照或不关注他们只是刷单元格。
您可以注册5个Twitter帐户到这个应用程序。

KATAOMOI的意思是说，你爱一个人，但他或她不会用日语来爱你。用Twitter，你跟随某人，但他或她没有跟随你。
在KATAOMOI视图中，删除单元格的作用是取消关注他或她。

KATAOMOWARE的意思是，你不爱某个人，但他或她用日语来爱你。用Twitter，你不是跟着某个人，而是他或她跟着你。
在KATAOMOWARE视图中，删除单元格按照他或她的方式工作。

